import React, { Component } from 'react';

class SingleExperience extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <p></p>
      </div>
    )
  }
}

class WorkExperience extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    const experiences = [];
    const userInfo = this.props.userInfo;
    return (
      <div>
        <h2>Experiences</h2>
        {experiences}
      </div>
    )
  }
}

export default WorkExperience;
